import React from 'react';
import S from './Interes.module.css'
import { useState } from 'react';
const Interes = () => 
{
    const [interes, ChangeInteres] = useState("Ебаться в жопу")
    const [showVvod, setShowVvod] = useState(false)
    return(
        <div className={S.wrapper}>
     <div className={S.Interes} onClick={() => setShowVvod(true)}>
         {interes}
     </div>
     {vvod}
     </div>
    )
}

export default Interes;
